DELIMITER $$
CREATE TRIGGER `actualizar_tipo` BEFORE INSERT ON `usuario` FOR EACH ROW BEGIN 
        IF NEW.correo LIKE '%@vigilante%' THEN
            SET NEW.tipo = 'Vigilante';
        ELSEIF NEW.correo LIKE '%@admin%' THEN
            SET NEW.tipo = 'Administrador';
        END IF;
    END
$$
DELIMITER ;

